async function callApi(path, body) {
    if (body) {
        const response = await fetch(path, {
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            method: 'POST',
            body: JSON.stringify(body)
        });

        return response.json();
    }

    const response = await fetch(path);

    return response.json();
}

